import React, { useState } from "react";

const Search = () => {
  const [img, setImg] = useState("");

  const inputEvent = (event) => {
      setImg(event.target.value)
  };


  return (
    <>
      <section>
        <input
          type="text"
          placeholder="Search"
          onChange={inputEvent}
          value={img}
        />
      </section>
    </>
  );
};

export default Search;
